//go:build cgo && ((linux && amd64) || (darwin && amd64) || (darwin && arm64) || (windows && amd64)) && sphincs_sha2_256f

package tests

import (
	"encoding/hex"
	"testing"

	"github.com/stretchr/testify/require"
  sphincsplus "github.com/ioerror/sphincsplus/ref"
)

func TestSignVerifyVectorSpecifics(t *testing.T) {

	privKey := new(sphincsplus.PrivateKey)
	privKeyBytes, err := hex.DecodeString("93d8d7aff683728c175300103dfe1cf98042820b3f77fad93bd6c54eb430c935b49b651bc12a267293dee932c62f1aa96bd75daed339c8e554ae9e090e71ee75e0900c256c5ce2ec0112df5b5a861cbdf44fc1c53f042e5a2add246c22cc306a3ccb3d02de04d6c69ece144e6874976890cf50aaf50a967f4f77fc5e90947a5f")
	require.NoError(t, err)
	err = privKey.FromBytes(privKeyBytes)
	require.NoError(t, err)

	pubKey := new(sphincsplus.PublicKey)
	pubKeyBytes, err := hex.DecodeString("e0900c256c5ce2ec0112df5b5a861cbdf44fc1c53f042e5a2add246c22cc306a3ccb3d02de04d6c69ece144e6874976890cf50aaf50a967f4f77fc5e90947a5f")
	require.NoError(t, err)
	err = pubKey.FromBytes(pubKeyBytes)

	signature, err := hex.DecodeString("")
	require.NoError(t, err)

	t.Logf("SPHINCS+ scheme parameters: %s", sphincsplus.SchemeName())
	t.Logf("priv key %x", privKey.Bytes())
	t.Logf("pub key %x", pubKey.Bytes())
	t.Logf("sig %x", signature)
	message := []byte("i am a message")
	require.True(t, pubKey.Verify(signature, message))

}
